import React from "react";
import Header from '../components/header'
import Unity, { UnityContent, UnityContext } from 'react-unity-webgl'

const Badminton = () => {
  return (<>
    <div id="wrapper">
    <Header />
    <div id="main">

      <div class="align-center">
        <a href="/" class="button">Back</a>
      </div>
    </div>
    </div>
    </>
  );
};

export default Badminton;
